                        {getuser.map(store => (<option value={store.uuid}> {store.instructor_info} </option>))}
                        </select>
                    </div>
                </div>

        </div>

        </div>

        </CModalBody>
        <CModalFooter>
            <div className="col-md-12 text-center">
            <CButton color="primary" onClick={NewInstructor}>Save</CButton>{' '}
            <CButton 
            color="secondary" 
            onClick={() => setPrimary(false)}
            >Close</CButton>
            </div>

        </CModalFooter>
    </CModal>

